#include <stdio.h>
#include <stdlib.h>

void swap(unsigned int *a, unsigned int *b) {
    unsigned int temp = *a;
    *a = *b;
    *b = temp;
}

// Partition function
int partition(unsigned int arr[], int low, int high) {
    unsigned int pivot = arr[high]; // Choose the last element as the pivot
    int i = low - 1;               // Index of the smaller element

    for (int j = low; j < high; j++) {
        // If the current element is smaller than or equal to the pivot
        if (arr[j] <= pivot) {
            i++;
            swap(&arr[i], &arr[j]);
        }
    }
    // Swap the pivot element with the element at index (i+1)
    swap(&arr[i + 1], &arr[high]);
    return i + 1; // Return the partition index
}

// QuickSort function
void quickSort(unsigned int arr[], int low, int high) {
    if (low < high) {
        // Partition the array
        int pi = partition(arr, low, high);

        // Recursively sort the subarrays
        quickSort(arr, low, pi - 1);  // Before pivot
        quickSort(arr, pi + 1, high); // After pivot
    }
}




